"""# Manual LSTM Architecture"""

import numpy as np
import tensorflow as tf
from tensorflow.keras.layers import Layer, Dense
from tensorflow.keras.models import Sequential
from tensorflow.keras.optimizers import Adam

class ManualLSTM(Layer):
    def __init__(self, units, return_sequences=False, **kwargs):
        super(ManualLSTM, self).__init__(**kwargs)
        self.units = units
        self.return_sequences = return_sequences

    def build(self, input_shape):
        input_dim = input_shape[-1]

        # Forget gate weights
        self.Wf = self.add_weight(shape=(input_dim, self.units),
                                initializer='glorot_uniform',
                                name='Wf')
        self.Uf = self.add_weight(shape=(self.units, self.units),
                                initializer='orthogonal',
                                name='Uf')
        self.bf = self.add_weight(shape=(self.units,),
                                initializer='zeros',
                                name='bf')

        # Input gate weights
        self.Wi = self.add_weight(shape=(input_dim, self.units),
                                initializer='glorot_uniform',
                                name='Wi')
        self.Ui = self.add_weight(shape=(self.units, self.units),
                                initializer='orthogonal',
                                name='Ui')
        self.bi = self.add_weight(shape=(self.units,),
                                initializer='zeros',
                                name='bi')

        # Output gate weights
        self.Wo = self.add_weight(shape=(input_dim, self.units),
                                initializer='glorot_uniform',
                                name='Wo')
        self.Uo = self.add_weight(shape=(self.units, self.units),
                                initializer='orthogonal',
                                name='Uo')
        self.bo = self.add_weight(shape=(self.units,),
                                initializer='zeros',
                                name='bo')

        # Cell state weights
        self.Wc = self.add_weight(shape=(input_dim, self.units),
                                initializer='glorot_uniform',
                                name='Wc')
        self.Uc = self.add_weight(shape=(self.units, self.units),
                                initializer='orthogonal',
                                name='Uc')
        self.bc = self.add_weight(shape=(self.units,),
                                initializer='zeros',
                                name='bc')

    def call(self, inputs):
        batch_size = tf.shape(inputs)[0]
        h_t = tf.zeros((batch_size, self.units))
        c_t = tf.zeros((batch_size, self.units))

        outputs = []
        for t in range(inputs.shape[1]):
            x_t = inputs[:, t, :]

            # Forget gate
            f_t = tf.sigmoid(tf.matmul(x_t, self.Wf) + tf.matmul(h_t, self.Uf) + self.bf)

            # Input gate
            i_t = tf.sigmoid(tf.matmul(x_t, self.Wi) + tf.matmul(h_t, self.Ui) + self.bi)

            # Candidate cell state
            c_hat_t = tf.tanh(tf.matmul(x_t, self.Wc) + tf.matmul(h_t, self.Uc) + self.bc)

            # Update cell state
            c_t = f_t * c_t + i_t * c_hat_t

            # Output gate
            o_t = tf.sigmoid(tf.matmul(x_t, self.Wo) + tf.matmul(h_t, self.Uo) + self.bo)

            # Update hidden state
            h_t = o_t * tf.tanh(c_t)

            outputs.append(h_t)

        if self.return_sequences:
            return tf.stack(outputs, axis=1)
        else:
            return outputs[-1]

# Build model
def build_lstm_model(input_shape, units=64):
    model = Sequential([
        ManualLSTM(units, return_sequences=True, input_shape=input_shape),
        ManualLSTM(units//2, return_sequences=False),
        Dense(1)
    ])
    return model

# Example usage
input_shape = (12, 1)  # 12 timesteps, 1 feature
model = build_lstm_model(input_shape)

# Compile the model
model.compile(optimizer=Adam(learning_rate=0.001),
              loss='mse',
              metrics=['mae'])

